import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";

const Map = withScriptjs(
    withGoogleMap(props => (
        <GoogleMap defaultZoom={8} onClick={props.handleClickedMap} defaultCenter={{ lat: -34.397, lng: 150.644 }}
        >
            {props.isMarkerShown &&
                props.markers.map(marker => (
                    <Marker
                        position={{
                            lat: marker.latitude,
                            lng: marker.longtitude
                        }}
                    />
                ))}
        </GoogleMap>
    ))
);

export default Map;

